void asn1Copy_x2ap_X2AP_PDU (OSCTXT* pctxt, const x2ap_X2AP_PDU* pSrcValue, 
   x2ap_X2AP_PDU* pDstValue)
{
   if (pSrcValue == pDstValue)
      return;

   pDstValue->t = pSrcValue->t;
   switch (pSrcValue->t)
   {
      /* initiatingMessage */
      case 1:
         pDstValue->u.initiatingMessage = rtxMemAllocType (pctxt, x2ap_InitiatingMessage);

         if (0 == pDstValue->u.initiatingMessage) {
            return;
         }

         asn1Init_x2ap_InitiatingMessage (pDstValue->u.initiatingMessage);
         if (0 == pDstValue->u.initiatingMessage) {
            return;
         }
         asn1Copy_x2ap_InitiatingMessage (pctxt, pSrcValue->u.initiatingMessage, pDstValue->u.initiatingMessage);
         break;

      /* successfulOutcome */
      case 2:
         pDstValue->u.successfulOutcome = rtxMemAllocType (pctxt, x2ap_SuccessfulOutcome);

         if (0 == pDstValue->u.successfulOutcome) {
            return;
         }

         asn1Init_x2ap_SuccessfulOutcome (pDstValue->u.successfulOutcome);
         if (0 == pDstValue->u.successfulOutcome) {
            return;
         }
         asn1Copy_x2ap_SuccessfulOutcome (pctxt, pSrcValue->u.successfulOutcome, pDstValue->u.successfulOutcome);
         break;

      /* unsuccessfulOutcome */
      case 3:
         pDstValue->u.unsuccessfulOutcome = rtxMemAllocType (pctxt, x2ap_UnsuccessfulOutcome);

         if (0 == pDstValue->u.unsuccessfulOutcome) {
            return;
         }

         asn1Init_x2ap_UnsuccessfulOutcome (pDstValue->u.unsuccessfulOutcome);
         if (0 == pDstValue->u.unsuccessfulOutcome) {
            return;
         }
         asn1Copy_x2ap_UnsuccessfulOutcome (pctxt, pSrcValue->u.unsuccessfulOutcome, pDstValue->u.unsuccessfulOutcome);
         break;

      /* extElem1 */
      case 4:
         pDstValue->u.extElem1 = rtxMemAllocType (pctxt, ASN1OpenType);

         if (0 == pDstValue->u.extElem1) {
            return;
         }

         pDstValue->u.extElem1->numocts = 0;
         pDstValue->u.extElem1->data = 0;
         if (0 == pDstValue->u.extElem1) {
            return;
         }
         if (! rtCopyOpenType (pctxt, pSrcValue->u.extElem1, pDstValue->u.extElem1))
            return;
         break;

   }

   return;
}

